import logo from '../imgs/Mines_Paris_logo.jpg'

interface Props {
    title: String
    description : String
}

function Header(props : Props) {
    return (
        <div className='header'>
            <h1>{props.title} </h1>
            <p> 
                <em>Click on any API to show its <strong>definition</strong></em>
            </p>
            <img 
                alt="Mines Paris logo"
                src={logo}   
                height={150}
            />
        </div>
    )
}

export default Header
